function App() {
  return (
    <div className="App">

      <div>
      <p> why is this so difficult?</p>
      <p><Cards/></p>
      </div>
      <header className='App-header'>
      <Button1/>
      </header>

      </div> 
  );
}

function Button1() {
  return (
  <div>
  <Button>Did this work Scott???</Button>
  </div>
  );
}

function Cards() {
  return (
  <div>
  <CRow>

  <CCol sm={6}>
   <Card className='mb-3' style={{ color: "#000" }}>

      <Card.Body>

      <Card.Title>About</Card.Title>

      </Card.Body>

  </Card>
  </CCol>

  <Card className='mb-3' style={{ color: "#000" }}>

   <Card.Body>

      <Card.Title>
            About
      </Card.Title>          
      </Card.Body>

    </Card>
  </CRow>
  </div>
  );
}
export default App;
